import "./coffeList.scss";
import Coffe1 from "../img/coffe-1.png";




const CoffeList = ({clickevent}) =>{

    return(

       <ul className="coffe-list">

            <li onClick={()=>{clickevent(1)}}><img src={Coffe1}/></li>
            <li onClick={()=>{clickevent(2)}}><img src={Coffe1}/></li>
            <li onClick={()=>{clickevent(3)}}><img src={Coffe1}/></li>

       </ul>


    )

}

export default CoffeList;
